                  "strength": 0.9047619047619048,
                  "description": "About Unofficial page of Gazprom Export - the World’s Largest Exporter Of Natural Gas. Additional Information OOO Gazprom Export is the World’s Largest Exporter Of Natural Gas.     OOO Gazprom Export is one of the most successful and ad vanced Russian companies, the size  ... of its export earnings largely fills in Russia 's budget re venues. In 2011, the volume of natural gas exports to far-abroad countries amounted to 150 billion cubic meters.     Russia’s gas exports constitute a vital part of European energy security, which has been borne out by more than 40 years of experience in supplying gas to the European continent. For this reason the management of Gazprom Export devotes particular attention to the company’s reputation in the eyes of its partners and the public.     Conformity of the company’s operations with the interests of gas-importing nations: our priority rests in ensuring reliable and stable supplies. Our history of supplying gas to Europe confirms that despite the tumultuous political changes that have been affecting both the purchasing country and the former Soviet Union over the years we are still capable of providing our clients with uninterrupted supplies.     Our benchmarks:  •attracting investments for the development of Russian gas transmission and distribution networks;  •earning revenues from transit and storage of Russian gas;  •improving the environment through a reliance on gas instead of other energy sources.     Gazprom Export upholds the principles of bearing social responsibility for the results of its work, at the same time contributing to the development of the Russian gas industry and the economy as a whole.     Conformity of the company’s operations with Russia’s national interests:  •contributing to Russia’s fuel and energy export development and maintaining a positive foreign trade balance;  •boosting Russia’s role on the global fuel and energy market;  •expanding the economic base in order to improve cooperation with nations that import Russian gas;  •increasing foreign currency earnings;  •attracting investment to the Russian gas industry;  •improving the nation’s employment rate and income level;  •employment in the fields of gas transportation and imported gas distribution.",
